// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract CustomERC1155 {
    mapping(uint256 => mapping(address => uint256)) public balances;

    event MultiItemMinted(address indexed to, uint256 indexed itemId, uint256 amount);
    event MultiItemTransferred(address indexed from, address indexed to, uint256 indexed itemId, uint256 amount);

    function mintItem(address _to, uint256 _itemId, uint256 _amount) external {
        balances[_itemId][_to] += _amount;
        emit MultiItemMinted(_to, _itemId, _amount);
    }

    function transferItem(address _to, uint256 _itemId, uint256 _amount) external {
        require(balances[_itemId][msg.sender] >= _amount, "ERC1155: Insufficient Balance");
        balances[_itemId][msg.sender] -= _amount;
        balances[_itemId][_to] += _amount;
        emit MultiItemTransferred(msg.sender, _to, _itemId, _amount);
    }
}

contracts/CustomERC20.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract CustomERC20 {
    string public name = "VaultTokenX";
    string public symbol = "VTX";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    event TokenTransferred(address indexed from, address indexed to, uint256 value);
    event TokenApproval(address indexed owner, address indexed spender, uint256 value);

    constructor(uint256 _initialSupply) {
        totalSupply = _initialSupply * 10 ** uint256(decimals);
        balanceOf[msg.sender] = totalSupply;
    }

    function transfer(address _to, uint256 _amount) external returns (bool) {
        require(balanceOf[msg.sender] >= _amount, "VTX: insufficient balance");
        balanceOf[msg.sender] -= _amount;
        balanceOf[_to] += _amount;
        emit TokenTransferred(msg.sender, _to, _amount);
        return true;
    }

    function approve(address _spender, uint256 _amount) external returns (bool) {
        allowance[msg.sender][_spender] = _amount;
        emit TokenApproval(msg.sender, _spender, _amount);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _amount) external returns (bool) {
        require(balanceOf[_from] >= _amount, "VTX: insufficient balance");
        require(allowance[_from][msg.sender] >= _amount, "VTX: allowance exceeded");
        balanceOf[_from] -= _amount;
        balanceOf[_to] += _amount;
        allowance[_from][msg.sender] -= _amount;
        emit TokenTransferred(_from, _to, _amount);
        return true;
    }
}

contracts/CustomERC721.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract CustomERC721 {
    string public name = "CollectorNFTX";
    string public symbol = "CNFX";
    uint256 public currentTokenId;

    mapping(uint256 => address) public ownerOf;
    mapping(address => uint256) public balanceOf;

    event NFTMinted(address indexed to, uint256 tokenId);

    function mintNFT(address _to) external returns (uint256) {
        currentTokenId += 1;
        ownerOf[currentTokenId] = _to;
        balanceOf[_to] += 1;
        emit NFTMinted(_to, currentTokenId);
        return currentTokenId;
    }
}

contracts/LootBox.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

import "./CustomERC20.sol";
import "./CustomERC1155.sol";
import "./CustomERC721.sol";
import "./SecurePseudoVRF.sol";

contract LootBox {
    CustomERC20 public vaultToken;
    CustomERC721 public nftToken;
    CustomERC1155 public multiAsset;
    SecurePseudoVRF public vrf;

    uint256 public boxPrice = 0.0001 ether;

    struct Reward {
        uint8 rewardType;  // 1=ERC20, 2=ERC721, 3=ERC1155
        uint256 itemId;    // This is for ERC721/ERC1155
        uint256 amount;    // This is for ERC20/ERC1155
        uint16 weight;     // 0-10000
    }

    Reward[] public rewards;
    uint16 public totalWeight;

    event BoxOpened(address indexed user, uint8 rewardType, uint256 itemId, uint256 amount);
    event BoxPriceUpdated(uint256 newPrice);
    event RewardAdded(uint8 rewardType, uint256 itemId, uint256 amount, uint16 weight);

    constructor(address _vaultToken, address _nftToken, address _multiAsset, address _vrf) {
        vaultToken = CustomERC20(_vaultToken);
        nftToken = CustomERC721(_nftToken);
        multiAsset = CustomERC1155(_multiAsset);
        vrf = SecurePseudoVRF(_vrf);
    }

    function setBoxPrice(uint256 _price) external {
        boxPrice = _price;
        emit BoxPriceUpdated(_price);
    }

    function addReward(uint8 _type, uint256 _itemId, uint256 _amount, uint16 _weight) external {
        rewards.push(Reward(_type, _itemId, _amount, _weight));
        totalWeight += _weight;
        emit RewardAdded(_type, _itemId, _amount, _weight);
    }

    function openBox() external payable {
        require(msg.value >= boxPrice, "LootBox: Insufficient fee");

        uint256 rand = vrf.getSecureRandomNumber(totalWeight);
        uint16 cummulative;

        Reward memory wonReward;

        for (uint index = 0; index < rewards.length; index++) {
            cummulative += rewards[index].weight;

            if(rand < cummulative) {
                wonReward = rewards[index];
                break;
            }
        }

        if(wonReward.rewardType == 1) {
            vaultToken.transfer(msg.sender, wonReward.amount);
        } else if(wonReward.rewardType == 2) {
            nftToken.mintNFT(msg.sender);
        } else if(wonReward.rewardType == 3) {
            multiAsset.mintItem(msg.sender, wonReward.itemId, wonReward.amount);
        }

        emit BoxOpened(msg.sender, wonReward.rewardType, wonReward.itemId, wonReward.amount);
    }

    function withdrawFunds(address payable _to) external {
        _to.transfer(address(this).balance);
    }
}

contracts/SecurePseudoVRF.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract SecurePseudoVRF {
    uint256 private nonce;

    event RandomNumberGenerated(address indexed user, uint256 randomNumber);

    function getSecureRandomNumber(uint256 _max) external returns (uint256 random) {
        require(_max > 0, "SecureVRF: max must be greater than 0");

        nonce++;

        bytes32 entropy = keccak256(
            abi.encodePacked(
                blockhash(block.number - 1),
                block.timestamp,
                msg.sender,
                nonce,
                block.prevrandao
            )
        );

        random = uint256(entropy) % _max;

        emit RandomNumberGenerated(msg.sender, random);
    }
}

